import React from 'react';
import Listsitem from './Lists-item';
function Lists() {
	return (
		<ul className="list-group">
			<Listsitem media="Facebook" id="facebook" img="https://picsum.photos/60" />
			<Listsitem media="Youtube" id="youtube" img="https://picsum.photos/61" />
			<Listsitem media="Instgram" id="nstgram" img="https://picsum.photos/62" />
		</ul>
	);
}

export default Lists;
